import React from "react";
import s from "./Profile.module.css"
import Posts from "./Posts/Posts";
import ProfileInfo from "./ProfileInfo";
const Profile =(state)=>{
    return(
        <div className={s.profile}>
            <ProfileInfo />
            <Posts state={state}/>
        </div>
    )
}
export default Profile;
